from playwright.sync_api import sync_playwright

with sync_playwright() as playwright:
    # Access existing browser session
    browser = playwright.chromium.connect_over_cdp("http://localhost:9222/")
    default_context = browser.contexts[0]
    # this page object already points to your current url
    page = default_context.pages[0]

    # Interact with the table elements to search for veterinarians with the speciality "none"
    page.evaluate("""() => {
        let veterinarians = document.querySelectorAll("table#vets tbody tr");
        let count = 0;
        for (let vet of veterinarians) {
            let specialties = vet.querySelector("td:nth-child(2)").innerText.trim();
            if (specialties === "none") {
                count++;
            }
        }
        console.log("Number of veterinarians with speciality 'none':", count);
    }""")

    # Print the current url's html code
    print(page.content())
    # Print the current url itself
    print(page.url)
